import React from "react";
import NavBarMenu from "./components/NavBarMenu";
import Footer from "./common/Footer";

function App() {
  return (
    <React.Fragment>
      <NavBarMenu />
      <Footer />
    </React.Fragment>
  );
}

export default App;
